#include <fstream>
#include <iostream> 
void badSymbol(char symbols[256], const char* subStr, int n) {
    for (int i = 0; i < n; ++i) {
        symbols[(int)subStr[i]] = i;
    }
}
int main(int argc, const char* argv[])
{
    const char* str = argv[1];
    std::ifstream inFile(argv[2]);
    char buffer[524288 + 1024];
    char symbols[256];
    for (int i = 0; i < 256; ++i) {
        symbols[i] = -1;
    }
    int i = 0;
    int j = 0;
    int n = 0;
    int m = 0;
    while (str[m] != '\0') {
        ++m;
    }
    int sum = 0;

    badSymbol(symbols, str, m);

    while (true) {
        inFile.read(buffer, 524288);
        n = inFile.gcount();
        inFile.getline(buffer + 524288, 1024);
        n += inFile.gcount();
        if (n == 0) { break; }
        int s = 0;
        while (s <= (n - m)) {
            int j = m - 1;
            while (j >= 0 && str[j] == buffer[s + j]) {
                --j;
            }
            if (j < 0) { 
                ++s;
                ++sum;
            }
            else {
                s += abs(j - symbols[static_cast<unsigned char>(buffer[s + j])]);
            }
        }
    }
    std::cout << sum << std::endl;
}
